import { gql } from '@apollo/client';

export const CREATE_HAIKU_MUTATION = gql`
mutation createHaiku($content: String!, $id: ID, $featured: Boolean!, $collected: Boolean!, $submitted: Boolean!, $createdAt: DateTime!) {
  createHaikus(input: [
      {
        id: $id
        content: $content
        featured: $featured
        collected: $collected
        submitted: $submitted
        createdAt: $createdAt
      }
  ])
  haikus {
    id
    content
  }
}
`;
